    false,nt"url": null,nt"notes": "nThe Glacier Photograph Collection is a
    database of photographs of glaciers from around the world, some dating back to the
    mid-1850's, that provide an historical reference for glacier extent. As of June
    2015, the database contains over 15,000 photographs.NSIDC houses thousands of photographic
    prints of glaciers taken from the ground, the air, and from space. These photographs
    constitute an important historical record, as well as a data collection of interest
    to those studying the response of glaciers to climate change. NSIDC partnered with
    the NOAA Climate Database Modernization Program (CDMP) and the National Geophysical
    Data Center (NGDC) to digitize selected photographs and make them available through
    a searchable interface.Most of the photographs are of glaciers in the Rocky Mountains,
    the Pacific Northwest, Alaska, and Greenland. However, the collection does include
    a smaller number of photos of glaciers in Europe, South America, the Himalayas,
    and Antarctica. The photos are available online via a searchable interface and are
    retrievable by glacier name, photographer name, date, country, state, and geographic
    coordinates.n",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
